-----------------------------------------------------------------------
-- SQL Script to create and populate database table for the exercise --
-- --------------------------------------------------------------------

-- Check and drops the course_details table if already exists
------------------------------------------------------------- 
DROP TABLE IF EXISTS COURSE_DETAILS;

-- Recreates the course details table
-------------------------------------------------------------
CREATE TABLE  COURSE_DETAILS(
    ID INT PRIMARY KEY, 
    CODE VARCHAR2(20) NOT NULL UNIQUE, 
    NAME VARCHAR2(255) NOT NULL, 
	FIELD VARCHAR2(50) NOT NULL,
    DURATION NUMBER(4), 
    FEES NUMBER(10), 
    MODE VARCHAR2(20) NOT NULL, 
    LEVEL VARCHAR2(10) NOT NULL, 
    BEGINS DATE NOT NULL,
	LISTED_ON DATE NOT NULL,
	CONSTRAINT CD_CODE_IDX UNIQUE (CODE),
	CONSTRAINT CD_COMB_IDX UNIQUE (CODE,FIELD,MODE,LEVEL)
);

-- Inserts data into the above created table
--------------------------------------------------------------

commit;